//Save to the file in array format
void save_to_file(int16_t* sums, int n_c)
{
    char filename[32];
    sprintf(filename, "array_%d", n_c);

    FILE* f = fopen(filename, "w");

    for(int i = 0; sums[i] != 0; i++)
    {
        fprintf(f,"0x%04x,", sums[i] & 0xFFFF);
    }

    fclose(f);
}

void write_str(int16_t* ptr, char c1, char c2, int offset)
{
    ptr += 0x10E; //Where our string is located
    ptr[offset] = c1;
    ptr[offset+1] = c2;
}

int execute(int16_t* ptr,uint16_t sum)
{
    //Overwrite the sum
    ptr[ptr[ptr[0]]] = sum;

    //Continue execution
    while ( ptr[0] < 0x4B6E )
    {
        WORD op_addr = ptr[ ptr[0] ];
        WORD res;

        if ( op_addr == -2 )
        {
            return 0;
        }

        if ( op_addr == -1 )
        {
            ptr[0]++;
        }
        else
        {
            res = ptr[op_addr] - ptr[1];

            //This is our check : IP == 0x203d
            if ( ptr[0] == 0x203d )
            {
                if ( res == 0)
                {
                    //if the result is zero then the { sum , two characters } combination is correct
                    return 1;
                }
                else
                {
                    //Fail !
                    return 0;
                }
            }

            ptr[1] = res;

            if ( op_addr != 2 )
            {
                ptr[op_addr] = res;
            }

            if ( res < 0 )
            {
                ptr[0]++;
            }

            ptr[0]++;
        }

        if ( ptr[6] == 1 )
        {
            ptr[6] = ptr[4] = 0;
        }

    }
    return 0;
}

int snapshot_vm_memory_first(int16_t* ptr ,int n_c)
{
    int c = 0;
    while ( ptr[0] < 0x4B6E )
    {
        WORD op_addr = ptr[ ptr[0] ];
        WORD res;

        //Execute until the target iteration is reached
        if ( ptr[0] == 0x14bb && c++ == n_c )
        {
            //Our snapshot is ready ! return
            return 1;
        }

        if ( op_addr == -2 )
        {
            return 0;
        }

        if ( op_addr == -1 )
        {
            ptr[0]++;
        }
        else
        {
            res = ptr[op_addr] - ptr[1];

            ptr[1] = res;

            if ( op_addr != 2 )
            {
                ptr[op_addr] = res;
            }

            if ( res < 0 )
            {
                ptr[0]++;
            }

            ptr[0]++;
        }

        if ( ptr[6] == 1 )
        {
            ptr[6] = ptr[4] = 0;
        }
    }
    return 0;
}

int snapshot_vm_memory_second(int16_t* ptr, char c1, char c2, int offset)
{
    //Write the two characters at the offset correspondent to the current check
    write_str(ptr, c1, c2, offset);

    while ( ptr[0] < 0x4B6E )
    {
        WORD op_addr = ptr[ ptr[0] ];
        WORD res;

        //This is where the sum is added to the calculated value
        //We take a snapshot here since we need to bruteforce that sum
        if ( ptr[0] == 0x1ff7)
        {
            return 1;
        }

        if ( op_addr == -2 )
        {
            return 0;
        }

        if ( op_addr == -1 )
        {
            ptr[0]++;
        }
        else
        {
            res = ptr[op_addr] - ptr[1];

            ptr[1] = res;

            if ( op_addr != 2 )
            {
                ptr[op_addr] = res;
            }

            if ( res < 0 )
            {
                ptr[0]++;
            }

            ptr[0]++;
        }

        if ( ptr[6] == 1 )
        {
            ptr[6] = ptr[4] = 0;
        }
    }
    return 0;
}

int main()
{

    //Initialize the string to 64 bytes by default
    char* str = "JUNKJUNKJUNKJUNKJUNKJUNKJUNKJUNKJUNKJUNKJUNKJUNKJUNKJUNKJUNKJUNK"; //64 bytes
    int16_t* vm_str = (int16_t*)initial_state + 0x10E;
    for(int i =0; i < strlen(str); i++)
    {
        *vm_str = (uint16_t)str[i];
         vm_str++;
    }

    //Allocate necessary memory
    int16_t* snapshot_1 = malloc(VM_SZ);
    int16_t* snapshot_2 = malloc(VM_SZ);
    int16_t* snapshot_2_tmp = malloc(VM_SZ);
    int16_t* sums = malloc(SUMS_SZ);
    int16_t* next_sums = malloc(SUMS_SZ);

    //initialize the sums for the first iteration
    for(int i = 1; i <= 0xFFFF; i++)
    {
        sums[i-1] = i;
    }
    sums[0xFFFF] = 0;


    //n_c represents the current check.
    for ( int n_c = 0; n_c < 15; n_c++)
    {
        int next_sums_i = 0;
        memset(next_sums, 0, SUMS_SZ);

        memcpy(snapshot_1, initial_state, VM_SZ);
        if ( ! snapshot_vm_memory_first(snapshot_1,n_c) )
        {
            printf("fatal error !\n");
            return 0;
        }

        //For each two characters, bruteforce the valid sum
        for( unsigned char c1 = 0x20; c1 <= 0x7F; c1++ )
        {
            for ( unsigned char c2 = 0x20; c2 <= 0x7F; c2++)
            {
                //Take a second snapshot after the calculation and right at where the sum comparison takes place
                memcpy(snapshot_2, snapshot_1, VM_SZ);
                if ( ! snapshot_vm_memory_second(snapshot_2, c1, c2, n_c * 2) )
                {
                    printf("fatal error 2\n");
                    return 0;
                }

                for( int i = 0; sums[i] != 0 ; i++)
                {
                    memcpy(snapshot_2_tmp, snapshot_2, VM_SZ);
                    //Run the check
                    if ( execute(snapshot_2_tmp, sums[i]) )
                    {
                        printf("Found : %c%c with sum = %04x\n", c1,c2, sums[i] & 0xFFFF);
                        //keep this sum for the next check
                        next_sums[next_sums_i++] = sums[i];
                    }
                }
            }
        }

        memset(sums, 0 ,SUMS_SZ);
        //Re-initialize the sums array with the new filtered sums.
        memcpy(sums, next_sums, SUMS_SZ);
        //in case the code fails or we stop its execution, we can recover easily without running this all over again.
        //We also recover the final sums array from the file "array_14" thanks to this.
        save_to_file(sums, n_c);
    }

    free(snapshot_1);
    free(snapshot_2);
    free(snapshot_2_tmp);
    free(sums);
    free(next_sums);
}
